import { Button, Checkbox, Form, Input, DatePicker, Select } from 'antd';
import React, { Dispatch, SetStateAction, useState } from 'react';

type NewParamFormProp  = {
  created: boolean
};

const NewParamForm =  ({created}: NewParamFormProp): JSX.Element  => {
  const [nameSelected, setNameSelected] = useState(false);  
  const onFinish = (values: any) => {
    console.log('Success:', values);
  };

  const paramNames = [
    {
    "name": "Aluminio dissolvido",
    "value": "aluminioDissolvido"
   },
   {
    "name":"Arsênio total",
    "value":"arsenioTotal"
   },
   {
    "name":"Chumbo total",
    "value":"chumboTotal"
   },
   {
    "name":"Cobre dissolvido",
    "value":"cobreDissolvido"
   },
   {
    "name":"Escherichia coli",
    "value":"escherichiaColi"
   },
   {
    "name":"Cromo total",
    "value":"cromoTotal"
   },
   {
    "name":"Cádmio total",
    "value":"cadmioTotal"
   },
   {
    "name":"DBO",
    "value":"dbo"
   }
]

  const onFinishFailed = (errorInfo: any) => {
    console.log('Failed:', errorInfo);
  };

  return (
    <Form
      name="basic"
      labelCol={{ span: 8 }}
      wrapperCol={{ span: 16 }}
      initialValues={{ remember: true }}
      onFinish={onFinish}
      onFinishFailed={onFinishFailed}
      autoComplete="off"
    >
      <Form.Item
        label="Nome"
        name="name"
        rules={[{ required: true, message: 'Please input your username!' }]}
      >
        <Select onSelect={() => setNameSelected(true)}>
          {paramNames.map((param) => <Select.Option value={param.value}>{param.name}</Select.Option>)}
        </Select>
      </Form.Item>

      <Form.Item
        label="Valor"
        name="value"
        rules={[{ required: true, message: 'Please input your username!' }]}
      >
        <Input disabled={nameSelected}/>
      </Form.Item>
      <Form.Item label="Data de coleta">
          <DatePicker />
        </Form.Item>
    </Form>
  );
};

export default NewParamForm;
